import React from "react";
import SimpleSlider from "Pages/person/photo/PhotoSlider/SimpleSlider";
import {
  PhotoConteiner,
  SimpleSliderConteiner,
  AddBtn,
  ButtonMobile,
  BtnConteiner,
} from "./style";
import saveVCard from "Features/saveVCard";
import Data from "Entites/Data";

export default function Photo() {
  return (
    <PhotoConteiner>
      <SimpleSliderConteiner>
        <SimpleSlider />
      </SimpleSliderConteiner>
      <AddBtn onClick={() => saveVCard(Data.person)}>
        Добавить в контакты
      </AddBtn>
      <BtnConteiner>
        <ButtonMobile>сохранить визитку</ButtonMobile>
        <ButtonMobile>позвонить</ButtonMobile>
      </BtnConteiner>
    </PhotoConteiner>
  );
}
